import React, { Component } from "react";
import {Col, Row, Container} from "../components/Grid";
import Nav from "../components/Nav";



class Home extends Component {
    render(){
        return(
            <Container>
                <Nav/>
            <p>Yep this is the Home Page</p>
            </Container>
        )
    }
}

export default Home;
